script: |
  super -f text -I q2573.spq | sort > q2573.out

inputs:
  - name: q2573.spq
    data: |
      SELECT col2 / - + col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 + + - col1 IN ( col0 + + - col2 );
  - name: tab1

outputs:
  - name: q2573.out
    data: |
      -1
      -1
      -1
